import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:google_fonts/google_fonts.dart';
import 'package:my_travel/src/models/travel_model.dart';
import 'package:my_travel/src/ui/screens/add-travel-dialog/add-travel-dialog.dart';
import 'package:my_travel/src/ui/widgets/country_preview.dart';

import 'country_detail.dart';

class ListCountries extends StatelessWidget {
  final String title;
  final String country;
  final DateTime date;

  ListCountries({
    Key key,
    this.title,
    this.country = 'Germany',
  }) : date = DateTime(2021, 4, 6);

  @override
  Widget build(BuildContext context) {

    return Scaffold(
      appBar: AppBar(
          backgroundColor: Colors.black,
          title: Row(
            mainAxisAlignment: MainAxisAlignment.center,
            children: [
              Text(title,
                  style: GoogleFonts.lobster(
                      textStyle:
                      TextStyle(fontSize: 34.0, color: Colors.white))),
            ],
          )),
      body: ListView.builder(
        itemBuilder: _itemBuilder,
        itemCount: 8,
      ),
      floatingActionButton: FloatingActionButton(
        onPressed: () {
          Navigator.push(
            context,
            MaterialPageRoute<void>(
              builder: (BuildContext context) => FullScreenDialog(),
              fullscreenDialog: true,
            ),
          );
        },
        elevation: 5,
        tooltip: 'Aggiungi viaggio',
        child: Icon(Icons.add),
      ), // This trailing comma makes auto-formatting nicer for build methods.
    );
  }

  Widget _itemBuilder(BuildContext context, int index) {
    String base64string =
        '';
    MemoryImage img = MemoryImage(base64Decode(base64string));

    return CountryPreview(
        country: Travel(
            countryName: country,
            date: date,
            img: img
        ),
        onTapped: () {
          Navigator.push(
            context,
            MaterialPageRoute(builder: (context) => CountryDetail(
              country: Travel(
                  countryName: country,
                  date: date,
                  img: img
              ),
            )),
          );
        }
    );
  }
}
